# -*- coding: utf-8 -*-
import unittest
from unittest import TestCase

from factory.backends.base import compiler_lt


class BaseBackendTestCase(TestCase):
    def test_compiler_lt(self):
        self.assertFalse(compiler_lt('0.3.13', '0.3.12'))
        self.assertFalse(compiler_lt('0.3.13', '0.3.13'))
        self.assertTrue(compiler_lt('0.3.13', '0.3.14'))


if __name__ == '__main__':
    unittest.main()
